create table pcr_credit_acc
(
    id                          varchar(64)    not null comment '主键ID',
    order_id                    varchar(64)    null comment '订单流水号',
    serial_id                   varchar(64)    null comment '数据流水号',
    etl_id                      varchar(64)    null comment '清洗流水号',
    report_id                   varchar(32)    null comment '报告编号',
    creditacc_account_no        varchar(30)    null comment '账户编号',
    creditacc_account_code      varchar(60)    null comment '账户类型',
    org_type                    varchar(60)    null comment '业务管理机构类型',
    org_no                      varchar(60)    null comment '业务管理机构代码',
    account_id                  varchar(100)   null comment '账户标识',
    creditagree_account_no      varchar(100)   null comment '授信协议编号',
    creditacc_business_code     varchar(60)    null comment '业务种类',
    opened_datetime             datetime       null comment '开立日期',
    currency_code               varchar(60)    null comment '币种',
    loan_amount                 decimal(12, 2) null comment '借款金额',
    creditacc_credit            decimal(12, 2) null comment '账户授信额度',
    share_credit                decimal(12, 2) null comment '共享授信额度',
    creditacc_due_datetime      datetime       null comment '到期日期',
    repay_method                varchar(60)    null comment '还款方式',
    repay_rate                  varchar(60)    null comment '还款频率',
    repay_periods               int            null comment '还款期数',
    guarantee_code              varchar(60)    null comment '担保方式',
    loan_issuance_code          varchar(60)    null comment '贷款发放形式',
    com_loan_sign               varchar(60)    null comment '共同借款标志',
    creditacc_repay_status_code varchar(60)    null comment '债券转移时的还款状态',
    create_time                 datetime       not null comment '入库时间',
    primary key (id, create_time)
)
    comment 'D_01-借款账户信息-基本信息' engine = InnoDB;

create index idx_etl_report_account_no
    on pcr_credit_acc (etl_id, report_id, creditacc_account_no);

